'''
leet : 1268

# sol1
products에서 접두사가 같은 글자 product를 최대 3개까지만 뽑아라

각 글자의 길이마다 하나씩 가져와서 start, end 인덱스를 계산함
현재 단어 길이가 더 짧거나, 포함하고 있지 않는 경우 각 인덱스가 증감한다.
'''
class Solution:
    def suggestedProducts(self, products: list[str], searchWord: str) -> list[list[str]]:
        # sol1 76ms 86% 19.32MB 86%
        products.sort()
        print(products)
        ans = []
        start, end = 0, len(products)-1
        for i, c in enumerate(searchWord):
            # start 단어 길이가 더 길거나 현재 글자가 더 작을 경우
            while start <= end and (i >= len(products[start]) or products[start][i] < c):
                start += 1
            # end 단어 길이가 더 길거나 현재 글자가 더 클 경우
            while start <= end and (i >= len(products[end]) or products[end][i] > c):
                end -= 1
            print(start, end)
            if start <= end:
                ans.append(products[start:min(start+3, end+1)])
            else:
                ans.append([])
        return ans

  
print(Solution().suggestedProducts(["mobile","mouse","moneypot","monitor","mousepad"], "mouse"))
